import React from "react";
import styled from "styled-components";
import Navbar from "../components/Navbar";
import RecipeCard from "../components/RecipeCard";
import { Link } from "react-router-dom";
import data from "../data";

const HomeContainer = styled.div`
  padding: 20px;
  text-align: center;
`;

const WelcomeBanner = styled.div`
  background: #f1f1f1;
  padding: 50px;
  margin-bottom: 20px;
`;

const WelcomeMessage = styled.h2`
  margin-bottom: 10px;
`;

const Description = styled.p`
  font-size: 18px;
  margin-bottom: 20px;
`;

const CallToAction = styled.div`
  margin: 20px 0;
`;

const CTAButton = styled(Link)`
  padding: 10px 20px;
  background-color: #fbf9f7;
  color: black;
  text-decoration: none;
  border: 1px solid #ccc;
  border-radius: 5px;
  margin: 0 10px;

  &:hover {
    background-color: #e1e1e1;
  }
`;

const FeatureHighlights = styled.div`
  display: flex;
  justify-content: space-around;
  margin: 20px 0;
`;

const Feature = styled.div`
  width: 30%;
`;

const FeatureIcon = styled.div`
  font-size: 50px;
  margin-bottom: 10px;
`;

const FeatureText = styled.p`
  font-size: 16px;
`;

const SampleRecipes = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center; /* Center align cards */
  margin: 20px 0;
`;

const Home = ({ isLoggedIn, userName }) => {
  return (
    <div className="home-container">
      <Navbar isLoggedIn={isLoggedIn} userName={userName} />
      <HomeContainer>
        {isLoggedIn ? (
          <>
            <WelcomeMessage>Welcome back, {userName}!</WelcomeMessage>
            <CallToAction>
              <CTAButton to="/add-recipe">Add New Recipe</CTAButton>
              <CTAButton to="/all-recipes">View All Recipes</CTAButton>
            </CallToAction>
            <SampleRecipes>
              <h3>Recent Recipes</h3>
              {data.map((recipe) => (
                <RecipeCard key={recipe.id} recipe={recipe} />
              ))}
            </SampleRecipes>
          </>
        ) : (
          <>
            <WelcomeBanner>
              <WelcomeMessage>Welcome to Recipe Taker!</WelcomeMessage>
              <Description>
                Keep track of your favorite recipes, add new ones, and never
                lose track of your culinary creations.
              </Description>
              <CallToAction>
                <CTAButton to="/register">Sign Up</CTAButton>
                <CTAButton to="/login">Login</CTAButton>
              </CallToAction>
            </WelcomeBanner>
            <FeatureHighlights>
              <Feature>
                <FeatureIcon>📚</FeatureIcon>
                <FeatureText>Save all your recipes in one place.</FeatureText>
              </Feature>
              <Feature>
                <FeatureIcon>📝</FeatureIcon>
                <FeatureText>
                  Add, update, and delete recipes easily.
                </FeatureText>
              </Feature>
              <Feature>
                <FeatureIcon>🔍</FeatureIcon>
                <FeatureText>Search and find recipes quickly.</FeatureText>
              </Feature>
            </FeatureHighlights>
            <SampleRecipes>
              <h3>Sample Recipes</h3>
              {data.map((recipe) => (
                <RecipeCard key={recipe.id} recipe={recipe} />
              ))}
            </SampleRecipes>
          </>
        )}
      </HomeContainer>
    </div>
  );
};

export default Home;
